import styles from "../styles/Sidebar.module.css";

import { ReactComponent as RightArrowIcon } from "../icons/right_arrow.svg";
import { ReactComponent as CatIcon } from "../icons/cat.svg";
import { ReactComponent as AlienIcon } from "../icons/alien.svg";
import { ReactComponent as DeathStarIcon } from "../icons/death_star.svg";
import { ReactComponent as SpaceShuttleIcon } from "../icons/space_shuttle.svg";

const Sidebar = (props) => {
  return (
    <div className={props.className}>
      <nav className={styles["sidebar"]}>
        <ul className={styles["sidebar-nav"]}>
          <li className="logo">
            <a href="#" className={styles["sidebar-link"]}>
              <span className={styles["link-text logo-text"]}></span>
              <RightArrowIcon />
            </a>
          </li>

          <li className={styles["sidebar-item"]}>
            <a href="#" className={styles["sidebar-link"]}>
              <CatIcon />
              <span className={styles["link-text"]}>Dashboard</span>
            </a>
          </li>

          <li className={styles["sidebar-item"]}>
            <a href="#" className={styles["sidebar-link"]}>
              <AlienIcon />
              <span className={styles["link-text"]}>Monthly Spending</span>
            </a>
          </li>

          <li className={styles["sidebar-item"]}>
            <a href="#" className={styles["sidebar-link"]}>
              <DeathStarIcon />
              <span className={styles["link-text"]}>Investments</span>
            </a>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Sidebar;
